import React, { useState } from 'react';

function Navbar() {
  const [is, set] = useState(false);

  return (
    <div className="text-white flex bg-black justify-between p-8">
      {is && (
        <div className="fixed top-0 left-0 h-screen w-screen z-999 bg-black flex flex-col items-center justify-center">
          <a href="/">
            <h1 className="text-7xl">Home</h1>
          </a>
          <a href="/">
            <h1 className="text-5xl">Portfolio</h1>
          </a>
          <a href="/">
            <h1 className="text-5xl">Contact Me</h1>
          </a>
        </div>
      )}
      <div>
        <h1 className="text-xl">M.Grissa</h1>
      </div>
      <div>
        <i onClick={() => set(!is)} className="fa-solid fa-bars text-xl"></i>
      </div>
    </div>
  );
}

export default Navbar;
